import styled from "styled-components";


export const MapContainer = styled.div `{

	width: 100%;
	height: 55%;
	border: 20px;
	box-shadow: 10px 8px 20px 5px rgb(0 0 0 / 50%);

	display: flex;
    flex-direction: row;

	}
`;
